import React from 'react'

function Search(prop) {
    return (
        <section className="search-box-wrap">
            <input type="text" placeholder="Please type search term here i.e Titanic" className="search-box" onChange={prop.event}></input>
            <label>{prop.id}</label>
        </section>
    )
}

export default Search
